import type { jsPDF } from 'jspdf';

const ROBOTO_REGULAR_BASE64 =
    '';

let isRobotoFontRegistered = false;

export const ensureRobotoFont = (doc: jsPDF) => {
    if (isRobotoFontRegistered) {
        doc.setFont('Roboto-Regular', 'normal');
        return;
    }

    doc.addFileToVFS('Roboto-Regular.ttf', ROBOTO_REGULAR_BASE64);
    doc.addFont('Roboto-Regular.ttf', 'Roboto-Regular', 'normal', 'Identity-H');
    isRobotoFontRegistered = true;
    doc.setFont('Roboto-Regular', 'normal');
};
